    // Day 1 - part 1 - total distance between list
    private static int totalDistanceBetweenList(List<Integer> list1, List<Integer> list2) {
        Collections.sort(list1);
        Collections.sort(list2);
        int sumOfDistance = 0;

        for (int i = 0; i < list1.size(); i++) {
            sumOfDistance += Math.abs(list1.get(i) - list2.get(i));
        }
        return sumOfDistance;
    }

    // Day 1 - part 2 - similarity score
    private static int similarityScore(List<Integer> list1, List<Integer> list2) {

        HashMap<Integer, Integer> similarityMap = new HashMap<>();
        int totalSimilarities = 0;

        for (int num : list1) {
            similarityMap.put(num, 0);
        }
        for (int num : list2) {
            if (similarityMap.get(num) != null) {
                similarityMap.put(num, similarityMap.get(num) + 1);
            }
        }
        for (Map.Entry<Integer, Integer> entry : similarityMap.entrySet()) {
            totalSimilarities += (entry.getKey() * entry.getValue());
        }
        return totalSimilarities;
    }

    // Day 2 part 1 - safe levels
    private static int countSafeReports(int[][] reports) {
        int safeCount = 0;

        for (int[] report : reports) {
            if (isSafe(report) || canBeMadeSafe(report)) {
                safeCount++;
            }
        }
        return safeCount;
    }

    private static boolean isSafe(int[] levels) {
        boolean increasing = levels[1] > levels[0]; // Determine direction.
        for (int i = 0; i < levels.length - 1; i++) {
            int diff = levels[i + 1] - levels[i];

            if (Math.abs(diff) < 1 || Math.abs(diff) > 3) {
                return false;
            }

            if (increasing && diff < 0 || !increasing && diff > 0) {
                return false;
            }
        }
        return true;
    }

    // Day 2 part 2 - remove single level
    private static boolean canBeMadeSafe(int[] levels) {
        for (int i = 0; i < levels.length; i++) {
            int[] modifiedLevels = new int[levels.length - 1];
            for (int j = 0, k = 0; j < levels.length; j++) {
                if (j != i) {
                    modifiedLevels[k++] = levels[j];
                }
            }
            if (isSafe(modifiedLevels)) {
                return true;
            }
        }
        return false;
    }

